export default function getStudentIdsSum(students) {
  if (students.length === 0) {
    return 0;
  }
  return students.reduce((accumulator, currentStudent) => {
    return accumulator + currentStudent.id;
  }, 0); // 0 is the initial value for the accumulator
};

